B.Bs=new A.bc(B.C_,["Native to the open grasslands of Brazil, Argentina and Paraguay, the Guira Cuckoo (Guira guira) is a sociable bird known for its distinctive scruffy appearance, long tail and cooperative behavior, often seen foraging in groups for insects and small prey.\n\nThis Guira Cuckoo specimen was collected by Charles Darwin during his famous voyage aboard the HMS Beagle. Now preserved at the Zoology and Marine Biology Museum at the University of Galway, it offers a rare glimpse into the biodiversity of 19th-century South America.\n\nUnlike many cuckoos, the Guira Cuckoo builds communal nests and lives in small flocks. It remind us of the importance of preserving both specimens and habitats to better understand and protect biodiversity.\n\n","In 1855, Queen\u2019s College Galway (now University of Galway) acquired a specimen of Azara's fox (Lycalopex griseus), also known as Patagonian fox. Like the other items in this collection, it was originally presented to the Zoological Society of London by Charles Darwin himself.\n\nIn the wild, Azara\u2019s Fox is found in open habitats like savannas and shrublands of Argentina, Paraguay, Uruguay, Bolivia and parts of Brazil, where it preys on small mammals, birds and insects. Known for its solitary and nocturnal habits, it plays a vital role in controlling prey populations.\n\nAzara's Fox is a versatile predator, thriving across a wide range of habitats and playing a crucial role in maintaining ecological balance. Preserved in the museum, the specimen offers valuable insights into a species that remains an integral part of South America\u2019s diverse ecosystems.\n\n","The South American Grison (Galictis cuja) is a small but tenacious carnivore, inhabiting diverse habitats such as forests, grasslands and wetlands across Argentina, Bolivia, Brazil, Paraguay and Uruguay. It preys on small animals which helps control populations of rodents.\n\nInterestingly, the South American Grison has a musky scent gland, which it uses to mark its territory and ward off potential predators, similar to its distant relatives, skunks and weasels. This pungent secretion not only serves as a defense mechanism but also helps individuals communicate.\n\nThe specimen of a South American Grison that is currently kept at the Museum was originally brought to Europe by Charles Darwin. As part of his extensive collection, it contributed to the foundational work that informed Darwin\u2019s development of the theory of evolution.\n\n","The South American Cavy (Cavia aperea) is a small herbivorous mammal found in grasslands, savannas, and forest edges across many parts of South America. It thrives in diverse environments, feeding on grasses and vegetation while serving as a key prey species for many predators.\n\nSouth American Cavies are highly social animals, often forming monogamous pairs or small family groups, and they communicate through a variety of vocalisations, including whistles and purrs. These vocal signals play a crucial role in maintaining group cohesion and warning of potential threats.\n\nThe specimen of a South American Cavy currently held at the Museum was brought to Europe by Charles Darwin during his voyage aboard the HMS Beagle. This specimen highlights the rich and diverse array of mammals Darwin encountered and studied during his groundbreaking expedition.\n\n"],t.hD)
